import{_ as e,c as r,o as t,ab as a}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"Переклад","description":"","frontmatter":{},"headers":[],"relativePath":"uk/contribute/translation.md","filePath":"uk/contribute/translation.md"}'),o={name:"uk/contribute/translation.md"},n=a(`<h1 id="переклад" tabindex="-1">Переклад <a class="header-anchor" href="#переклад" aria-label="Permalink to &quot;Переклад&quot;">​</a></h1><p>Ми хотіли б вашої допомоги для перекладу <em>QGroundControl</em>, метадані PX4 (у QGC), і наші керівництва по PX4, <em>QGroundControl</em> і MAVLink!</p><p>Наші документи (та _QGroundControl_використовують <a href="https://crowdin.com" target="_blank" rel="noreferrer">Crowdin</a> онлайн інструмент для перекладу. Crowdin автоматично імпортує вихідні теми з Github і представляє нові і змінені рядки для перекладу та/або перегляду (фінального затвердження).</p><p>Crowdin експортує перекладені документи назад на Github як &quot;Pull Request&quot; (яку команда розробників періодично переглядає та приймає). Експортований вивід містить вихідний документ з будь-яким перекладом і затвердженим текстом замінено перекладеними рядками (i. . Якщо рядок не перекладений/змінений, то він буде відображатися англійською).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Вам необхідний (безкоштовний) <a href="https://crowdin.com/join" target="_blank" rel="noreferrer">Crowdin account</a> для того щоб долучитись до команди українського перекладу!</p></div><p>:::note Перевагою цієї системи є те, що переклад уважно відслідковує вихідні документи. Читачі не будуть введені в оману через застарілі і неоновлені переклади. :::</p><h2 id="початок-роботи" tabindex="-1">Початок роботи <a class="header-anchor" href="#початок-роботи" aria-label="Permalink to &quot;Початок роботи&quot;">​</a></h2><p>Кроки з приєднання до нашої команди з перекладу такі:</p><ol><li><p>Зареєструватись на платформі Crowdin: <a href="https://crowdin.com/join" target="_blank" rel="noreferrer">https://crowdin.com/join</a></p></li><li><p>Відкрийте проект, до якого хочете приєднатися:</p><ul><li><a href="https://crowdin.com/project/qgroundcontrol" target="_blank" rel="noreferrer">QGroundControl</a> — інтерфейс QGroundControl і жорсткі кодовані рядки.</li><li><a href="https://crowdin.com/project/px4-metadata-translations" target="_blank" rel="noreferrer">PX4-Metadata-Translations</a> — параметр PX4 і опис подій у QGroundControl.</li><li><a href="https://crowdin.com/project/px4-user-guide" target="_blank" rel="noreferrer">PX4 Посібник користувача</a></li><li><a href="https://crowdin.com/project/qgroundcontrol-developer-guide" target="_blank" rel="noreferrer">QGroundControl Посібник розробника </a></li><li><a href="https://crowdin.com/project/qgroundcontrol-user-guide" target="_blank" rel="noreferrer"> QGroundControl Посібник користувача </a></li><li><a href="https://crowdin.com/project/mavlink" target="_blank" rel="noreferrer"> MAVLink Інструкція </a></li></ul></li><li><p>Виберіть мову, якою ви хочете перекладати</p></li><li><p>Натисніть кнопку <strong>Приєднатися</strong> (біля тексту <em>Ви повинні приєднатися до команди перекладачів, щоб мати можливість брати участь у цьому проекті</em>)</p><p>:::note Ви отримаєте повідомлення як тільки ваша заявка буде прийнята.</p></li></ol><p>:::</p><ol><li>Починайте перекладати!</li></ol><h2 id="особливі-примітки" tabindex="-1">Особливі примітки <a class="header-anchor" href="#особливі-примітки" aria-label="Permalink to &quot;Особливі примітки&quot;">​</a></h2><h3 id="не-змінюите-текст-префікса" tabindex="-1">Не змінюйте текст префікса! <a class="header-anchor" href="#не-змінюите-текст-префікса" aria-label="Permalink to &quot;Не змінюйте текст префікса!&quot;">​</a></h3><p>Vuepress використовує <code>::</code> щоб позначити початок нотаток, порад та попередження:</p><div class="language-html vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:::tip</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">The text for the tip.</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:::</span></span></code></pre></div><p>Текст для <code>:::tip</code> або <code>:::warning</code> і т. д. не повинен бути змінений, оскільки він визначає колір нотатки.</p><h2 id="додавання-новоі-мови" tabindex="-1">Додавання нової мови <a class="header-anchor" href="#додавання-новоі-мови" aria-label="Permalink to &quot;Додавання нової мови&quot;">​</a></h2><p>Якщо мова, яку ви хочете перекласти, не доступна тоді вам потрібно буде запросити його звернутися до власника проекту (на головній сторінці проекту є посилання на кожен проект).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Підтримка перекладу дуже тяжка! Перш ніж ви попросите нас створити нову мову, знайдіть кількох інших людей, щоб допомогти вам перекласти!</p></div><h2 id="отримання-допомоги" tabindex="-1">Отримання допомоги <a class="header-anchor" href="#отримання-допомоги" aria-label="Permalink to &quot;Отримання допомоги&quot;">​</a></h2><p>Інтерфейс <em>Crowdin</em> пояснюється сам за себе, але є багато додаткової інформації про <a href="https://support.crowdin.com/" target="_blank" rel="noreferrer">knowledgeable</a>.</p><p>Ви також можете попросити про допомогу перекладачів і розробників у спільноті Dronecode використовуючи <a href="./../contribute/support.html">наші канали підтримки</a>.</p>`,22),i=[n];function l(s,p,c,d,h,u){return t(),r("div",null,i)}const _=e(o,[["render",l]]);export{k as __pageData,_ as default};
